import Banner from './component/Banner';
import TextField from './component/TextField';

function App() {
  return (
    <div className="App">
      <Banner/>
      <TextField label="Nome" placeholder="Digite o seu nome"/>
      <TextField label="Cargo" placeholder="Digite seu cargo"/>
      <TextField label="Imagem"/>
    </div>
  );
}

export default App;
